import React, { Component } from "react";
import { NavbarConsumer } from "./NavbarContext";

class Navbar extends Component{

    render(){
        return (
            <NavbarConsumer>
                {(Navbar) => {
                    return (
                        Object.keys(Navbar).map(key => <li>{Navbar[key]}</li>)
                    );
                }}
            </NavbarConsumer>
        );
    }

}

export default Navbar;
